import { useRef, useState } from 'react'
import { Configuration, OpenAIApi } from 'openai'
import mergeImages from 'merge-images-v2'
import ReactToPrint from 'react-to-print'

const configuration = new Configuration({
  apiKey: 'API_KEY',
})
const openai = new OpenAIApi(configuration)

function App() {
  const [prompt, setPrompt] = useState('')
  const [image, setImage] = useState('')
  const [loading, setLoading] = useState(false)
  const [imageForPrint, setImageForPrint] = useState('')
  const [selectedFrame, setSelectedFrame] = useState('/skopenhouse1.png')
  const componentRef = useRef()

  async function handleSubmit(e) {
    e.preventDefault()
    setLoading(true)

    // const response = await openai.createImage({
    //   prompt: prompt,
    //   n: 1,
    //   size: '1024x1024',
    //   response_format: 'b64_json',
    // })
    // const data = response.data.data[0].b64_json

    // setImage(convertB64(data))

    setImage(
      'data:image/png;base64,'
    )
    setLoading(false)
  }

  function convertB64(b64) {
    let b64Data = b64
    return (b64Data = b64Data.replace(/^/, 'data:image/png;base64,'))
  }

  function imageWithFrame(image, frame) {
    mergeImages(
      [
        { src: frame, x: 0, y: 0 },
        { src: image, x: 238.5, y: 350, width: 763, height: 763 },
      ],
      {
        format: 'image/png',
      }
    ).then((b64) => {
      setImageForPrint(b64)
      console.log('done')
    })
  }

  function sync() {
    imageWithFrame(image, selectedFrame)
  }

  const options = [
    { name: 'Frame 1', value: '/skopenhouse1.png' },
    { name: 'Frame 2', value: '/skopenhouse2.png' },
  ]

  return (
    <div className='App min-h-screen bg-gradient-to-b from-ctp-base to-ctp-crust grid grid-cols-2'>
      <div>
        <div className='flex flex-col items-center justify-center'>
          <form onSubmit={handleSubmit}>
            <h1 className='from-ctp-pink to-ctp-mauve'>AI Art Generator</h1>
            <input onChange={(e) => setPrompt(e.target.value)} type='text' value={prompt} required className='bg-cyan-300 border rounded' />
            <button type='submit' className='bg-indigo-500 rounded' disabled={loading}>
              {loading ? 'Generating...' : 'Generate'}
            </button>
            {image && (
              <>
                <img src={image} alt='' width={512} height={512} />
                <label htmlFor='frame-select'>Choose a frame:</label>
                <select id='frame-select' onChange={(e) => setSelectedFrame(e.target.value)} value={selectedFrame}>
                  {options.map((option) => (
                    <option key={option.value} value={option.value}>
                      {option.name}
                    </option>
                  ))}
                </select>
                <button type='button' onClick={sync} className='bg-green-200 rounded px-2 py-1'>
                  Sync
                </button>
              </>
            )}
          </form>
        </div>
        </div>
        <div>
        {imageForPrint && (
          <div>
            <p>Preview:</p>
            <img src={imageForPrint} alt='' width={512} height={512} ref={componentRef} />
            <ReactToPrint
              trigger={() => (
                <button type='button' className='bg-yellow-200 rounded px-2 py-1'>
                  Print
                </button>
              )}
              content={() => componentRef.current}
            />
          </div>
        )}
        {loading && <p>Loading...</p>}
        </div>
    </div>
  )
}

export default App
